description:
This is Stanley Kubrick's &quot;Eyes Wide Shut&quot; with the audio replaced by Pink Floyd's &quot;Dark Side of the Moon,&quot; &quot;The Wall,&quot; and &quot;Wish You Were Here&quot; in that order.

Lots of strange things happen - watch for yourself and leave a comment.  If people are interested in these I will make more.


